import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './OsobaList.css'; // Import pliku stylów CSS

const OsobaList = () => {
    const [osoby, setOsoby] = useState([]);

    useEffect(() => {
        axios.get('http://localhost:8080/osoba')
            .then(response => setOsoby(response.data))
            .catch(error => console.error('Błąd pobierania danych: ', error));
    }, []);

    return (
        <div>
            <h2>Lista Osób</h2>
            <table className="osoba-table"> {/* Dodaj klasę do tabeli */}
                <thead>
                <tr>
                    <th>ID</th>
                    <th>Imię</th>
                    <th>Nazwisko</th>
                    <th>Data urodzenia</th>
                    <th>Numer telefonu</th>
                    <th>Adres</th>
                    <th>Praca</th>
                </tr>
                </thead>
                <tbody>
                {osoby.map(osoba => (
                    <tr key={osoba.id} className="osoba-row"> {/* Dodaj klasę do wiersza */}
                        <td>{osoba.id}</td>
                        <td>{osoba.imie}</td>
                        <td>{osoba.nazwisko}</td>
                        <td>{osoba.dataUrodzenia}</td>
                        <td>{osoba.numerTelefonu ? osoba.numerTelefonu.numer : 'Brak'}</td>
                        <td>{osoba.adres ? `${osoba.adres.ulica} ${osoba.adres.miasto}` : 'Brak'}</td>
                        <td>{osoba.praca ? osoba.praca.nazwa : 'Brak'}</td>
                    </tr>
                ))}
                </tbody>
            </table>
        </div>
    );
};

export default OsobaList;
